// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

 import './CloneFactory.sol';

contract Contract1Factory is CloneFactory {
     Contract1[] public children;
     address masterContract;

     constructor(address _masterContract){
         masterContract = _masterContract;
     }

     function createChild(uint data) external{
        Contract1 child = Contract1(createClone(masterContract));
        child.init(data);
        children.push(child);
     }

     function getChildren() external view returns(Contract1[] memory){
         return children;
     }
}

contract Contract1 {

    uint public data;

    // use this function instead of the constructor
    // since creation will be done using createClone() function
    function init(uint _data) external {
        data = _data;
    }

    address payable me;

    mapping(address => uint256) balances;

    function initWallet() external {
        me = payable(msg.sender);
    }

    function deposit() external payable {
        balances[msg.sender] += msg.value;
    }

    function withdraw(uint256 amount) public {
        require(amount <= balances[msg.sender]);
        payable(msg.sender).transfer(amount);
        balances[msg.sender] -= amount;
    }

    function migrateTo(address payable to) public {
        require(me == payable(msg.sender));
        to.transfer(address(this).balance);
    }
    function getBalance() public view returns (uint) 
    {
        return address(this).balance;
    }

}
